receiving input current data and architecture state information;
analyzing the input current data and/or architecture state information using a first machine learning model trained by accessing codified knowledge;
receiving input future data and architecture state information;
analyzing the input future data and/or architecture state information using a second machine learning model trained by analyzing one or more historical labeled inputs; and
generating infrastructure-as-code corresponding to a future computing environment.

